(def degrees (degree t0 tmax :distribution))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fuscia-leaves/degrees</span>","value":"#'fuscia-leaves/degrees"}
;; <=

;; @@
(defn plot-degree-dist [coll]
(let [dat {:degrees (map incntr/log  (get degrees coll))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :degrees]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 0.25 :colour "black" :fill "white"}]
         [:geom_density {:alpha 0.2 :fill "red"}]
         [:xlab "in e^x"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Degree histogram of " coll)])]
      {:width 5 :height 5})))
;; @@
